import '../App.css';
import NavBar from '../NavBar';
import DoubleInput from '../formComponents/DoubleInput';
import bg from '../Images/JWSTgalaxies.webp';

const Form = () => {
    return(
        <body style={{backgroundImage: `url({bg})`}}>
            <NavBar />
            <fieldset>
                <DoubleInput>

                </ DoubleInput>
            </fieldset>
        </body>
    )
}

export default Form;
